import React from 'react';
import eesa from '../images/eesa-icon.png';
import { makeStyles } from '@material-ui/styles';

const useStyles = makeStyles({
    logo: {
        height:70,
        width:193,
        paddingTop:10
    },
  });

const Bottom = () =>{
    return(
        <div>
            <img src={eesa}/>
        </div>
    );
};


export { Bottom };
